import React from 'react'
import Coin from './Coin';

import './CoinList.css'

const CoinList=({cryptoCoins})=>{
    return (
        <>
        <section className='CoinList'>
            {cryptoCoins.map((cryptoCoin)=>{
                console.log(cryptoCoin);
                return (
                    <Coin key={cryptoCoin.Id} 
                        {...cryptoCoin}/>
                );
            })}
        </section>
        </>
    );
}

export default CoinList;
